from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    sentence = ""
    subject_data = {}
    for triple in triples:
        if triple.subject not in subject_data:
            subject_data[triple.subject] = []
        subject_data[triple.subject].append(triple)

    for subject, data in subject_data.items():
        details = []
        for triple in data:
            if triple.predicate == "architecturalStyle":
                details.append(f"is built in {triple.object} style")
            elif triple.predicate == "buildingStartDate":
                details.append(f"started construction in {triple.object}")
            elif triple.predicate == "completionDate":
                details.append(f"and was completed in {triple.object}")
            elif triple.predicate == "floorCount":
                details.append(f"has {triple.object} floors")
            elif triple.predicate == "location":
                details.append(f"is located in {triple.object}")
            elif triple.predicate == "cost":
                details.append(f"cost {triple.object}")
            elif triple.predicate == "floorArea":
                details.append(f"has a floor area of {triple.object}")
            elif triple.predicate == "owner":
                details.append(f"is owned by {triple.object}")
            elif triple.predicate == "formerName":
                details.append(f"was formerly known as {triple.object}")
            elif triple.predicate == "height":
                details.append(f"is {triple.object} metres tall")
            elif triple.predicate == "buildingType":
                details.append(f"is a {triple.object}")
            elif triple.predicate == "developer":
                details.append(f"was developed by {triple.object}")
            elif triple.predicate == "tenant":
                details.append(f"has {triple.object} as a tenant")
            elif triple.predicate == "isPartOf":
                details.append(f"is part of {triple.object}")
            elif triple.predicate == "country":
                details.append(f"is located in {triple.object}")
            elif triple.predicate == "currentTenants":
                details.append(f"has current tenants including {triple.object}")
            elif triple.predicate == "address":
                details.append(f"is located at {triple.object}")
            elif triple.predicate == "inaugurationDate":
                details.append(f"was inaugurated on {triple.object}")
            else:
                details.append(f"has a {triple.predicate} of {triple.object}")

        if details:
            sentence += f"{subject} "
            if len(details) > 1:
                sentence += ", ".join(details) + "."
            else:
                sentence += details[0] + "."
    return sentence

